import React from 'react';
import { Box, Typography, Grid, Card, CardMedia, CardContent, Button, Fade, FormControl, InputLabel, Select, MenuItem } from '@mui/material';
import { styled } from '@mui/system';

const HeroSection = styled(Box)({
  height: '70vh',
  backgroundImage: `url(${menHeroImage})`,
  backgroundSize: 'cover',
  backgroundPosition: 'center',
  display: 'flex',
  flexDirection: 'column',
  justifyContent: 'center',
  alignItems: 'center',
  color: '#ffffff',
  textAlign: 'center',
  position: 'relative',
  '&::before': {
    content: '""',
    position: 'absolute',
    top: 0,
    left: 0,
    width: '100%',
    height: '100%',
    backgroundColor: 'rgba(0, 0, 0, 0.6)',
    zIndex: 1,
  },
});

const HeroContent = styled(Box)({
  zIndex: 2,
});

const SectionTitle = styled(Typography)({
  fontWeight: 'bold',
  color: '#000000',
  marginBottom: '30px',
  textAlign: 'center',
});

const ProductCard = styled(Card)({
  transition: 'transform 0.3s ease',
  '&:hover': {
    transform: 'scale(1.05)',
  },
});

const Men = () => {
  const [sortBy, setSortBy] = React.useState('price-low-high');

  const menProducts = [
    { id: 1, name: 'Black Oversized Tee', price: '₹999', image: 'https://via.placeholder.com/300x400' },
    { id: 2, name: 'Navy Blue Oversized Tee', price: '₹1099', image: 'https://via.placeholder.com/300x400' },
    { id: 3, name: 'Grey Oversized Tee', price: '₹899', image: 'https://via.placeholder.com/300x400' },
    { id: 4, name: 'White Oversized Tee', price: '₹999', image: 'https://via.placeholder.com/300x400' },
  ];

  return (
    <Box sx={{ flexGrow: 1 }}>
      {/* Hero Section */}

      {/* Product Grid with Filters */}
      <Box sx={{ py: 8, px: 4 }}>
        <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', mb: 4 }}>
          <SectionTitle variant="h4">Men's Collection</SectionTitle>
          <FormControl sx={{ minWidth: 200 }}>
            <InputLabel>Sort By</InputLabel>
            <Select
              value={sortBy}
              label="Sort By"
              onChange={(e) => setSortBy(e.target.value)}
            >
              <MenuItem value="price-low-high">Price: Low to High</MenuItem>
              <MenuItem value="price-high-low">Price: High to Low</MenuItem>
              <MenuItem value="newest">Newest Arrivals</MenuItem>
            </Select>
          </FormControl>
        </Box>
        <Grid container spacing={4}>
          {menProducts.map((product) => (
            <Grid item xs={12} sm={6} md={3} key={product.id}>
              <Fade in timeout={1000}>
                <ProductCard>
                  <CardMedia
                    component="img"
                    height="400"
                    image={product.image}
                    alt={product.name}
                  />
                  <CardContent>
                    <Typography variant="h6">{product.name}</Typography>
                    <Typography variant="body1" color="text.secondary">
                      {product.price}
                    </Typography>
                    <Button variant="outlined" sx={{ mt: 2 }}>
                      Add to Cart
                    </Button>
                  </CardContent>
                </ProductCard>
              </Fade>
            </Grid>
          ))}
        </Grid>
      </Box>

      {/* Testimonial Section */}
      <Box sx={{ py: 6, backgroundColor: '#f5f5f5', textAlign: 'center' }}>
        <SectionTitle variant="h4">What Our Customers Say</SectionTitle>
        <Typography variant="body1" sx={{ maxWidth: '600px', mx: 'auto' }}>
          "The best oversized tees I've ever worn! Super comfortable and stylish. Baa M Boo never disappoints!" – Arjun K.
        </Typography>
      </Box>
    </Box>
  );
};

export default Men;
